import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  state = {
    currencies: [
          {
          name:'Bitcoin',
          abrev: 'btc',
          price: 0,
          },
            {
          name: 'Ethereum',
          abrev: 'eth',
          price: 0,
          },
          {
          name: 'Litecoin',
          abrev: 'ltc',
          price: 0,
          },
          {
          name: 'US Dollar',
          abrev: 'usd',
          price: 0,
          }
        ],
  }



  render() {
      console.log(this.state.currencies[0].name);
      return (
        <div className="App">

          <nav className="nav"><a href="https://rjplaton.github.io/stellar-pairings/">XLM Chart</a>
          </nav>
          {this.state.currencies.map(currency => (
            <div>{currency.name}</div>  

            ))}


          <header className="header">
            <img src={logo} className="App-logo" alt="logo" />
          </header>




        </div>
      );
    }
  }

export default App;
